/** @format */

import "./App.css";
import Nav from "./Nav";
import { Switch, Route, Redirect } from "react-router-dom";

function App({ dogs }) {
  const names = dogs.map((d) => {
    return d.name;
  });
  return (
    <div className="App">
      <Nav names={names} />
      <Switch>
        <Route exact path="/dogs">
          <DogList dogs={dogs} />
        </Route>
        <Route path="/dogs/:name">
          <DogDetails dogs={dogs} />
        </Route>
        <Redirect to="/dogs" />
      </Switch>
    </div>
  );
}

export default App;
